import React, {useEffect, useState} from 'react'

const Queens = () => {
    const [queens, setQueens] = useState([]);

    useEffect(() => {
        fetch('http://localhost:9000/api/queens', {
            method: 'GET'
        })
        .then(queenList => {
            setQueens(queenList);
        })
        .catch(err => console.log(err));
    }, [])

    return (
        <div>
        </div>
    )
}

export default Queens
